import React, { Component } from "react";
import "./Profile.css";
import { Avatar, Typography, Button } from "@material-ui/core";
import { Link } from "react-router-dom";

class Profile extends Component {
  componentDidMount() {
    console.log("hello");
  }

  render() {
    return (
      <div className="profile">
        <div className="profile__top">
          <img
            src="https://resi.ze-robot.com/dl/4k/4k-desktop-wallpaper.-1920%C3%971200.jpg"
            alt="background"
          />
          <Avatar
            src="https://static.hollywoodreporter.com/sites/default/files/2019/03/avatar-publicity_still-h_2019-compressed.jpg"
            className="sidebar__avatar"
          ></Avatar>

          <div className="profile__stats">
            <div className="profile__stat">
              <h4>Malav Mevada</h4>
            </div>
            <Typography className="profile__stat">
              Student | Python Developer
            </Typography>
            <Typography className="profile__stat">
              Ahmedabad , India{" "}
              <Typography className="profile__stat_connections">
                +500 Connections
              </Typography>
            </Typography>

            <Link className="profile__stat_connections mt-2">Contact info</Link>
            <div className="profile__stat">
              <Button className="profile__stat_button">Open To</Button>
              <Button className="profile__stat_button">
                Add profile section
              </Button>
              <Button className="profile__stat_button">More</Button>
            </div>

            <div className="profile__stat">
              <p>Views of your post</p>
              <p className="profile__statNumber">67</p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Profile;
